pragma solidity 0.6.12;

import "@openzeppelin/contracts/math/SafeMath.sol";

contract YourContract {
    using SafeMath for uint256;

    address public owner;
    address public newowner;
    string public symbol;
    string public name;
    uint8 public decimals;
    uint256 public totalsupply;
    address public tokenowner;
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;
    mapping(address => uint256) public frozenaccountbyowner;
    uint256 public freecrawdeadline;
    address payable public beneficiary;
    uint256 public mingoal;
    uint256 public maxgoal;
    uint256 public price;
    uint256 public perprice;
    uint256 public perdeadline;
    uint256 public peramountraised;
    uint256 public pertokenamount;
    uint256 public pertokenamountmax;
    bool public crowdsaleclosed;
    bool public fundinggoalreached;
    uint256 public totalraised;
    uint256 public amountraised;
    uint256 public tokenamountrasied;
    uint256 public bonus01;
    uint256 public bonus01start;
    uint256 public bonus01end;
    uint256 public bonus02;
    uint256 public bonus02start;
    uint256 public bonus02end;
    uint256 public bonus;
    mapping(address => uint256) public fundbalance;

    constructor() public payable {
        owner = msg.sender;
        symbol = "";
        name = "";
        decimals = 18;
        totalsupply = 0x6765c793fa10079d0000000;
        balanceof[0xC92221388BA9418777454e142d4dA4513bdb81A1] = totalsupply;
        tokenowner = 0xC92221388BA9418777454e142d4dA4513bdb81A1;
        freecrawdeadline = 0x5b97e680;
        beneficiary = 0xC92221388BA9418777454e142d4dA4513bdb81A1;
        mingoal = 0xa2a15d09519be00000;
        maxgoal = 0x43c33c1937564800000;
        price = 7000;
        fundinggoalreached = false;
        crowdsaleclosed = false;
        amountraised = 0;
        tokenamountrasied = 0;
        bonus01 = 40;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function checkGoalReached() public {
        if (block.timestamp >= freecrawdeadline) {
            crowdsaleclosed = true;
            if (amountraised >= mingoal){
                fundinggoalreached = true;
            }
        }
        if (amountraised >= maxgoal && block.timestamp < freecrawdeadline) {
            crowdsaleclosed = true;
            if (amountraised >= mingoal){
                fundinggoalreached = true;
            }
        }
    }

    function approveAndCall(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function acceptOwnership() public {
        require(msg.sender == newowner, "You are not the new owner");
        owner = newowner;
        newowner = address(0);
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(block.timestamp > frozenaccountbyowner[_from], "Account frozen");
        require(_value > 0, "Transfer amount must be greater than zero");
        require(_value <= balanceof[_from], "Insufficient balance");
        require(_value <= allowance[_from][msg.sender], "Insufficient allowance");
        balanceof[_from] = balanceof[_from].sub(_value);
        balanceof[_to] = balanceof[_to].add(_value);
        allowance[_from][msg.sender] = allowance[_from][msg.sender].sub(_value);
        return true;
    }

    function managerAccount(address _target, bool _freeze) public {
        require(msg.sender == tokenowner, "You are not the token owner");
        frozenaccountbyowner[_target] = _freeze ? 1 : 0;
    }

    function perSaleWithDrawal() public {
        require(msg.sender == beneficiary, "You are not the beneficiary");
        require(peramountraised > 0, "No funds raised");
        beneficiary.transfer(peramountraised);
        peramountraised = 0;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_value > 0, "Transfer amount must be greater than zero");
        require(_value <= balanceof[msg.sender], "Insufficient balance");
        require(block.timestamp > frozenaccountbyowner[msg.sender], "Account frozen");
        balanceof[msg.sender] = balanceof[msg.sender].sub(_value);
        balanceof[_to] = balanceof[_to].add(_value);
        return true;
    }

    function transferOwnership(address _newowner) public {
        require(msg.sender == owner, "You are not the owner");
        newowner = _newowner;
    }

    function safeWithdrawal() public {
        if (block.timestamp >= freecrawdeadline) {
            if (!fundinggoalreached) {
                uint amount = fundbalance[msg.sender];
                if (amount > 0) {
                    if (msg.sender.send(amount)) {
                        fundbalance[msg.sender] = 0;
                    }
                }
            }

            if (fundinggoalreached && beneficiary == msg.sender) {
                if (beneficiary.send(address(this).balance)) {
                    peramountraised = 0;
                }
            }
        }

        if (amountraised >= maxgoal && block.timestamp < freecrawdeadline) {
            if (!fundinggoalreached) {
                uint amount = fundbalance[msg.sender];
                if (amount > 0) {
                    if (msg.sender.send(amount)) {
                        fundbalance[msg.sender] = 0;
                    }
                }
            }

            if (fundinggoalreached && beneficiary == msg.sender) {
                if (beneficiary.send(address(this).balance)) {
                    peramountraised = 0;
                }
            }
        }
    }

    fallback() external payable {
        require(!crowdsaleclosed, "Crowdsale is closed");
        uint amount = msg.value;
        require(amount != 0, "Cannot send 0 ether");
        fundbalance[msg.sender] = fundbalance[msg.sender].add(amount);
        amountraised = amountraised.add(amount);
        totalsupply = totalsupply.add(amount.div(price));
        balanceof[msg.sender] = balanceof[msg.sender].add(amount.div(price));
    }
}
